import React from 'react'
import { NavLink } from 'react-router-dom'
const Card = () => {
  return (
    <>
        <img src="https://picsum.photos/200/200" alt="image of card" className='image-card'></img>
        <h1 className='title-card'>Card title</h1>
        <p className='card des'>this is the example of how well bhavya can shit</p>
        <NavLink to="/" >click here</NavLink>
    </>
  )
}

export default Card
